description:
Plot: In a tiny laundrette hidden down an alleyway, where Rosa finds herself trapped, completely isolated and unable to escape the nightmarish situation of being attacked by a serial killer. At the break of dawn and after hours of anguish, immersed in the sadistic game of rat and mouse the killer has subjected her to, the young girl will discover something even more disturbing about the nature of her aggressor.


Genre: Action | Horror | Thriller
